import React from "react";
import MainPage from './com'
/* We simply can use an array and loop and print each user */
const NotFoundPage = () => {
  return (
    <body className = 'gc_body'>
      <div>
        <h1 className = 'nf_h1'>
            404 Page Not Found
        </h1>
        <p>
          <h1> You can go back to the <a href = './Main.js'> main page</a></h1>
          </p>
      </div>
    </body>
  );
};

export default NotFoundPage;
